import React from 'react';
import PropTypes from 'prop-types';

const TextBox = (props) => { 

    return(
        <div className="TextBox">
                           <div className="Title"> {props.title} </div>
                           <div className="Content">
                            <p>
                            {props.content}
                            </p>
                           </div>
        </div>
    )
}

export default TextBox;
